import React from 'react';
import Map from '../components/Map/Map';
import VehicleList from '../components/VehicleList/VehicleListItem';

function HomePage() {
  return (
    <div className="home-page">
      <h1>Dashboard</h1>
      <div className="dashboard-content">
        <Map />
        <VehicleList />
      </div>
    </div>
  );
}

export default HomePage;
